import ListGroup from "react-bootstrap/ListGroup";

const MisList = ({ mis }) => {
  const showDetails = (mis) => {
    return <h1>mis.name</h1>;
  };

  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <ListGroup.Item as="li" key={mis.id} onClick={showDetails(mis)}>
                {mis.name}
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
